# inverse maker

def make_complement(input_string):
    reverse_complement = []
    for l in input_string:
        if l == "A":
            O = "T"
        elif l == "T":
            O = "A"
        elif l == "C":
            O = "G"
        elif l == "G":
            O = "C"
        reverse_complement.append(O)
    reversed = ''.join(reverse_complement)[::-1]
    
    return reversed

test_string = ""
make_complement(test_string)